import React from "react";
import ButtonMain from "../../components/ButtonMain/ButtonMain";
// import HomeButton from "../../components/HomeButton/HomeButton";
import * as colorClasses from "../../utils/colorClasses";

export default function Main() {
  // let alphabet = "ABCDEFGHIJKLMNOPQRSTUVWXYZ".split("").reverse().join("");
  // let alphabet = "ABCDEFGHIJKLMNOPQRSTUVWXYZ".split("").reverse().join("");
  // let alphabet = "ABCDEFGHIJKLMNOPQRSTUVWXYZ";
  let alphabet = "ABCDEFGHIJKLMNOPQRSTUVWXYZ";
  let letterButtons = [];
  let i = 0;

  for (let letter of alphabet) {
    letterButtons.push(
      <>
        <div>
          <ButtonMain
            buttonClass={
              colorClasses.buttonClasses[
                i++ % colorClasses.buttonClasses.length
              ]
            }
          >
            Letter {letter}
          </ButtonMain>
        </div>
      </>
    );
  }
  return (
    <>
      <div className="mx-15 py-10 grid grid-cols-2 md:grid-cols-3 lg:grid-cols-4 gap-7">
        {letterButtons}
      </div>
    </>
  );
}
